const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<div class="ui5-product-switch-root" role="list" aria-label="${ifDefined(context._ariaLabelText)}" @focusin=${context._onfocusin} @keydown=${context._onkeydown}><slot></slot></div>`; };


